import React from "react";
import "./styles/index.css";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <main>
      <section></section>
      <h1>Homepage</h1>
      <Link to="/portfolio">Link to Portfolio</Link>
    </main>
  );
};

export default Home;
